/**
 * @param {string} s
 * @return {number}
 */
var lengthOfLongestSubstring = function(s) {
  // var strArr = s.split('');
  var strArr = s;
  if (strArr.length === 0) return 0;
  var length = strArr.length;
  var filterArr = [];
  var skip = 0;
  for (var i = 0; i < length; i += 1 + skip) {
    var currentStrArr = strArr[i];
    for (var j = i + 1; j < length; j++) {
      if (currentStrArr.indexOf(strArr[j]) > -1) break;
      currentStrArr += strArr[j];
    }
    // console.log('filterArr : ', filterArr);
    // console.log('current arr :', currentStrArr);
    if (filterArr.indexOf(currentStrArr) == -1) filterArr.push(currentStrArr);
    // if (currentStrArr.indexOf(strArr[j - 1]) > -1) {
    //   skip = j - i - 1;
    // } else {
    //   skip = 0;
    // }
  }
  // console.log('filter arr : ', filterArr);
  return (filterArr.map(ele => {
    return ele.length
  }).sort((a, b) => {
    return b - a
  }))[0];
};

